  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes an initial amphibian
  survey effort on the Baca National Wildlife Refuge, conducted on 7/17/15, 7/24/15,
  and 8/28/15. The main emphasis of this survey was to locate and document the presence
  of Rana pipiens (RAPI, northern leopard frog) on one of the major creeks that inundate
  the refuge from a northeast to southwest direction. These creeks (Crestone Creek,
  Willow Creek, Spanish Creek, Deadman, and Cottonwood Creek) all originate from the
  west slope of the Sangre de Cristo mountains, and serve as the primary source of
  water for the northern and central portions of the property. There have been historic
  reports of RAPI (2011) on lower sections of Willow creek (C. Hanson, pers. comm.),
  but this species has not been seen in substantial numbers in recent years. Surveys
  were conducted by Loreeu2019 Harvey, with the assistance of Dean Lee, Tayler Rocha,
  and Corinna Hanson.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
